import React, { useEffect } from "react";
import { useRouter } from "next/router";
import { Typography, Row, Col } from "antd";
import { useSelector } from "react-redux";
const { Text } = Typography;

import { v4 as uuid } from "uuid";
import calculator from "../back/calculator";

const Loading = () => {
	const router = useRouter();
	const { ans } = useSelector((state) => state.answer);

	if (ans) {
		const now = new Date();
		const uid = uuid();

		const userObj = {
			answer: ans,
			type: calculator(ans),
			created_at: now,
			updated_at: now,
		};
		router.push("/result/".concat(calculator(ans)));
	} else {
		router.push("/result/".concat(calculator([])));
	}

	useEffect(() => {
		setTimeout(() => {
			console.log(calculator(ans));
		}, 1000);
	}, []);

	return (
		<>
			<Row justify="space-around">
				<Col xs={16} sm={14} md={10} lg={8} xl={8}>
					<img
						src={require("../assets/images/v_curious.gif")}
						alt=""
						style={{ width: "100%", marginTop: "100px" }}
					/>
				</Col>
			</Row>
			<Row justify="center">
				<Col xs={16} sm={14} md={10} lg={8} xl={8}>
					<Text
						style={{
							textAlign: "center",
							display: "block",
							marginTop: "30px",
							fontSize: "20px",
						}}
					>
						분석중이개..
					</Text>
				</Col>
			</Row>
		</>
	);
};

export default Loading;
